import Vuex from 'vuex'

export const Store = new Vuex.Store({
    state: {
        FormComponentProps: {}
    },
    mutations: {
      setPropertiesRoute(state,payload){
        const key = payload.name;
        if (state.hasOwnProperty(key)) {
            state[key] = payload.props;
          }
      }
    }
  })
